import { Container, Stack } from "@mui/material";
import { Images } from "../Constants/images";
import { Search } from "@mui/icons-material";
import { useEffect, useState } from "react";
import dayjs from "dayjs";
import { DemoContainer, DemoItem } from "@mui/x-date-pickers/internals/demo";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DateRangeCalendar } from "@mui/x-date-pickers-pro/DateRangeCalendar";
import { useAuthContext } from '../hooks/useAuthContext'
const Home = () => {
  const Styles = {
    backgroundImage: `url(${Images.BG})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
    width: "100%",
  };
  const { user } = useAuthContext();
  const [range, setRange] = useState({
    startDate: new Date(),
    endDate: new Date(),
  });
  const [Searchval, setSearchval] = useState("");
  const [Guest, setGuest] = useState("");
  const [houses, sethouse] = useState([]);
  const [Room, setRooms] = useState("");
  const [value, setValue] = useState([
    dayjs("2022-04-17"),
    dayjs("2022-04-21"),
  ]);

  const start = (value[0].$d) // this string has (Thu Oct 12 2023 00:00:00 GMT+0530 (India Standard Time)) this value i need only oct 12
  const end = (value[1].$d) // this string has (Thu Oct 12 2023 00:00:00 GMT+0530 (India Standard Time)) this value i need only oct 12
  console.log(start);
  const date = new Date(start);
  const date1 = new Date(end);
const options = { year: 'numeric', month: 'short', day: '2-digit' };
const From = date.toLocaleDateString('en-US', options);
const To = date1.toLocaleDateString('en-US', options);

console.log(formattedDate); // Output: "Apr 01 2022"
  // Define custom styles for the date in the calendar
  
  useEffect(() => {
    fetch('http://localhost:4000/getallhouses', {
      method: 'GET',
      headers: {
        'Authorization': `Bearer ${user.token}`,
      },
    })
      .then((response) => response.json())
      .then((result) => {
        console.log(result)
        sethouse(result);
        const Houses = JSON.stringify(result);
        localStorage.setItem("houses",Houses);
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }, []);

  return (
    <section className="h-[120vh] w-screen">

      <div style={Styles}>
        <Container maxWidth="lg">
          <div className="w-[100%] h-[100%] ">
            <Stack
              direction={"column"}
              style={{ width: "100%", height: "780px" }}
            >
              <div className="my-[100px]">
                <h1 className="font-hometext text-center text-7xl text-primarycolor">
                  Your journey begins here
                </h1>
              </div>
              <div className="px-[20px] ">
                <div className="absolute w-[300px] h-[100px]"></div>
                <div
                  style={{
                    width: "100%",
                    height: "100%",
                    
                  }}
                  className="p-[30px] rounded-lg g"
                >
                  <Stack direction={"column"}>
                    <div className="h-[60px] my-[10px] w-[100%] p-[10px] ">
                      <h1 className="text-2xl font-mono text-center text-white underline">
                        Max House in Coimbator
                      </h1>
                    </div>
                    <div className="h-[70px] p-[10px] bg-white rounded-lg">
                      <Stack direction={"row"}>
                        <div className="p-[10px]">
                          <Search style={{ color: "#0a0a27" }} />
                        </div>
                        <div className="w-[100%]">
                          <input
                            type="text"
                            placeholder="Search..."
                            className="bg-transparent p-[10px] w-[100%] outline-none text-xl text-primarycolor"
                          />
                        </div>
                      </Stack>
                    </div>
                    <div className="my-[20px] h-[420px] bg-white rounded-lg text-primarycolor">
                      <h1 className="text-center text-2xl font-google">CheckIN and CheckOut Date</h1>
                      <Stack direction={"row"}>
                        <div>
                          <LocalizationProvider dateAdapter={AdapterDayjs}>
                            <DemoContainer
                              components={[
                                "DateRangeCalendar",
                                "DateRangeCalendar",
                              ]}
                            >
                              <DemoItem >
                                <DateRangeCalendar
                                  value={value}
                                  onChange={(newValue) => setValue(newValue)}
                                />
                              </DemoItem>
                            </DemoContainer>
                          </LocalizationProvider>
                        </div>
                        <div className="h-[200px] w-[200px] text-xl m-[30px]">
                          <div className="p-[10px]">
                             <h1>Rooms  and  Guest</h1> 
                          </div>
                          <hr></hr>
                          <div > 
                            <Stack direction={"column"}>
                              <div className="m-[10px]">
                                <p className="mb-[10px]">Rooms</p>
                              <input type="number" onChange={(e) => setRooms(e.target.value)} className="p-[10px] border-[3px] rounded-xl outline-none border-blue-600" placeholder="Enter the Rooms"/>
                              </div>
                              <div className="m-[10px]">
                                <p className="mb-[10px]">Guest</p>
                                <input type="number" onChange={(e) => setRooms(e.target.value)} className="p-[10px] border-[3px] rounded-xl outline-none border-blue-600" placeholder="Enter the Guest"/>
                              </div>
                              <div></div>
                            </Stack>
                          </div>
                        </div>
                      </Stack>
                    </div>
                  </Stack>
                  {/* <div className="h-[100%] w-[100%]">
                    {
                        houses.filter((houses) => {

                        })
                    }
                  </div> */}
                </div>
              </div>
            </Stack>
          </div>
        </Container>
      </div>
    </section>
  );
};

export default Home;
